import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="navbarMasterContai">
        <div className="navbarContainer">
          <div className="navbarHeader">BabySteps</div>
          <div className="navbarButton">
            <button>Signup</button>
          </div>
        </div>
    </div>
  );
};

export default Navbar;
